INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (126401, 1.47, 2002, 10001, "2023/09/22 14:59:59", 1, "2023/06/30 12:00:00", "クローチェ", 1, 0.0, "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", 2, 1, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (126401, 2.15, 2002, 10002, "2023/09/22 14:59:59", 2, "2023/06/30 12:00:00", "クローチェ", 1, 0.0, "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪", 1, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (126501, 0.0, 2002, 10003, "2023/09/22 14:59:59", 1, "2023/06/30 12:00:00", "ライラエル", 1, 0.0, "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", 2, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (126501, 0.0, 2002, 10004, "2023/09/22 14:59:59", 2, "2023/06/30 12:00:00", "ライラエル", 1, 0.0, "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 1, 1, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (127702, 0.0, 2002, 10005, "2023/12/22 14:59:59", 1, "2023/09/15 15:00:00", "リンド", 2, 0.0, "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 2, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (127702, 0.0, 2002, 10006, "2023/12/22 14:59:59", 2, "2023/09/15 15:00:00", "リンド", 2, 0.0, "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 2, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (127802, 0.0, 2002, 10007, "2023/12/22 14:59:59", 1, "2023/09/15 15:00:00", "ヴルム", 2, 0.0, "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 1, 1, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (127802, 6.5, 2002, 10008, "2023/12/22 14:59:59", 2, "2023/09/15 15:00:00", "ヴルム", 2, 0.0, "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 1, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (129602, 0.0, 2002, 10009, "2024/03/22 14:59:59", 1, "2023/12/15 15:00:00", "アネモネ", 3, 0.0, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 1, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (129602, 0.0, 2002, 10010, "2024/03/22 14:59:59", 2, "2023/12/15 15:00:00", "アネモネ", 3, 0.0, "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 1, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (129701, 0.0, 2002, 10011, "2024/03/22 14:59:59", 1, "2023/12/15 15:00:00", "ネフィ=ネラ", 3, 0.0, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 1, 1, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (129701, 6.2, 2002, 10012, "2024/03/22 14:59:59", 2, "2023/12/15 15:00:00", "ネフィ=ネラ", 3, 0.0, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 1, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (130301, 3.1, 2002, 10013, "2024/06/22 14:59:59", 1, "2024/03/15 15:00:00", "カノン", 4, 0.0, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 5, 3, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (130301, 6.15, 2002, 10014, "2024/06/22 14:59:59", 2, "2024/03/15 15:00:00", "カノン", 4, 0.0, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 2, 3, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (130401, 0.0, 2002, 10015, "2024/06/22 14:59:59", 1, "2024/03/15 15:00:00", "ナーナ", 4, 0.0, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 2, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (130401, 3.35, 2002, 10016, "2024/06/22 14:59:59", 2, "2024/03/15 15:00:00", "ナーナ", 4, 0.0, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 1, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (130502, 0.0, 2002, 10017, "2024/09/22 14:59:59", 1, "2024/06/15 15:00:00", "ホウオウ", 5, 0.0, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 1, 1, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (130502, 3.18, 2002, 10018, "2024/09/22 14:59:59", 2, "2024/06/15 15:00:00", "ホウオウ", 5, 0.0, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 1, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (130503, 0.0, 2002, 10019, "2024/09/22 14:59:59", 3, "2024/06/15 15:00:00", "ホウオウ", 5, 0.0, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 4, 4, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (123301, 4.9, 2002, 10020, "2024/09/22 14:59:59", 1, "2024/06/15 15:00:00", "ネア", 5, 0.0, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 2, 1, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (123301, 4.8, 2002, 10021, "2024/09/22 14:59:59", 2, "2024/06/15 15:00:00", "ネア", 5, 0.0, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 2, 1, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (133301, 4.922, 2002, 10022, "2024/12/22 14:59:59", 1, "2024/09/15 15:00:00", "カリザ", 6, 0.0, "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 1, 3, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (133301, 9.638, 2002, 10023, "2024/12/22 14:59:59", 2, "2024/09/15 15:00:00", "カリザ", 6, 0.0, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 5, 3, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (133401, 2.88, 2002, 10024, "2024/12/22 14:59:59", 1, "2024/09/15 15:00:00", "ミーア", 6, 0.0, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 2, 1, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (133401, 4.818, 2002, 10025, "2024/12/22 14:59:59", 2, "2024/09/15 15:00:00", "ミーア", 6, 0.0, "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 1, 5, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (133002, 1.78, 2002, 10026, "2025/03/22 14:59:59", 1, "2024/12/15 15:00:00", "グレイス", 7, 0.0, "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 1, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (133002, 6.15, 2002, 10027, "2025/03/22 14:59:59", 2, "2024/12/15 15:00:00", "グレイス", 7, 0.0, "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 7, 1, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (133102, 4.28, 2002, 10028, "2025/03/22 14:59:59", 1, "2024/12/15 15:00:00", "ヴァイオレット", 7, 0.0, "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 2, 6, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (133102, 0.0, 2002, 10029, "2025/03/22 14:59:59", 2, "2024/12/15 15:00:00", "ヴァイオレット", 7, 0.0, "じめじめした商品は\nございませんので\n安心してお買い求め下さい", 1, 1, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (136902, 5.53, 2002, 10030, "2025/06/23 14:59:59", 1, "2025/03/15 15:00:00", "ルルィ", 8, 0.0, "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", 1, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (136902, 6.05, 2002, 10031, "2025/06/23 14:59:59", 2, "2025/03/15 15:00:00", "ルルィ", 8, 0.0, "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", 7, 9, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (137001, 0.0, 2002, 10032, "2025/06/23 14:59:59", 1, "2025/03/15 15:00:00", "デュラン", 8, 0.0, "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", 1, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (137001, 0.0, 2002, 10033, "2025/06/23 14:59:59", 2, "2025/03/15 15:00:00", "デュラン", 8, 0.0, "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", 1, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (135902, 0.0, 2002, 10034, "2025/09/23 14:59:59", 1, "2025/06/16 15:00:00", "サツキ", 9, 0.0, "おう\n好きなもん持ってきな", 2, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (135902, 4.935, 2002, 10035, "2025/09/23 14:59:59", 2, "2025/06/16 15:00:00", "サツキ", 9, 0.0, "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ", 6, 1, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (135802, 7.441, 2002, 10036, "2025/09/23 14:59:59", 1, "2025/06/16 15:00:00", "ユキノ", 9, 0.0, "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？", 5, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (135802, 0.0, 2002, 10037, "2025/09/23 14:59:59", 2, "2025/06/16 15:00:00", "ユキノ", 9, 0.0, "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？", 7, 7, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (130901, 2.295, 2002, 10038, "2025/12/22 14:59:59", 1, "2025/09/16 15:00:00", "クルル", 10, 0.0, "クルルをお求めですかっ？\nそれならお礼に、こちらの\n宝石もどうぞですよ～♪", 2, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (130901, 6.281, 2002, 10039, "2025/12/22 14:59:59", 2, "2025/09/16 15:00:00", "クルル", 10, 0.0, "はっ！　ヒーローさんから\nお代なんて頂けないです！\nどうぞどうぞ…え、ダメ？", 6, 1, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (137701, 5.549, 2002, 10040, "2025/12/22 14:59:59", 1, "2025/09/16 15:00:00", "ヴォルガーノ", 10, 0.0, "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！", 1, 2, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (137701, 2.64, 2002, 10041, "2025/12/22 14:59:59", 2, "2025/09/16 15:00:00", "ヴォルガーノ", 10, 0.0, "…リマさんのブロマイド？\n買い取るに決まってらぁ！\nなんでも持ってけ泥棒っ！", 6, 3, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (132801, 7.642, 2002, 10042, "2026/03/23 11:59:59", 1, "2025/12/15 15:00:00", "ライラエル", 11, 0.0, "こ、この格好は…ヴルムが\n集客効果があると言って…\n…本当でしょうか？", 4, 7, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (132802, 0.0, 2002, 10043, "2026/03/23 11:59:59", 2, "2025/12/15 15:00:00", "ライラエル", 11, 0.0, "この我に店番させるとは…\n全て買わねば許さぬぞ\n我が国庫に貢献するが良い", 1, 1, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (134502, 0.0, 2002, 10044, "2026/03/23 11:59:59", 1, "2025/12/15 15:00:00", "クローチェ", 11, 0.0, "アナライズっ！\n本日のオススメ商品は～…\nこちらですっ♪", 1, 1, -470.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (134501, 3.72, 2002, 10045, "2026/03/23 11:59:59", 2, "2025/12/15 15:00:00", "クローチェ", 11, 0.0, "ギガンティックローチェ、\nおひとついかがですかっ？\n格納庫用意して下さいねっ", 1, 2, -470.0);
